public static COMMIT3Response deserialize(XDR xdr) {
  int status = xdr.readInt();
  long verf = 0;
  WccData fileWcc = WccData.deserialize(xdr);
  if (status == Nfs3Status.NFS3_OK) {
    verf = xdr.readHyper();
  }
  return new COMMIT3Response(status, fileWcc, verf);
}
